import React, { useState } from "react";
import axios from "axios";

const SearchInput = () => {
  const API_KEY = "26Cjl48gOvMj2jQKAAbJCRckpcH2IPlR9edG21W_hRM";
  const [query, setQuery] = useState("");
  const [data, setData] = useState([]);

  const searchImage = async (e) => {
    e.preventDefault();
    const getSearchImages = await axios.get(
      `https://api.unsplash.com/search/photos?query=${query}?per_page=30`,
      {
        headers: {
          Authorization: `Client-ID ${API_KEY}`,
        },
      }
    );
    console.log(getSearchImages.data.results);
    setData(getSearchImages.data.results);
  };

  return (
    <>
      <form>
        <label
          for="default-search"
          className="mb-2 text-sm font-medium text-gray-900 sr-only dark:text-white"
        >
          Search
        </label>
        <div className="mt-10 -mb-20 ml-auto mr-auto w-6/12 relative">
          <div className="absolute inset-y-0 left-0 flex items-center pl-3 pointer-events-none">
            <svg
              className="w-4 h-4 text-gray-500 dark:text-gray-400"
              aria-hidden="true"
              xmlns="http://www.w3.org/2000/svg"
              fill="none"
              viewBox="0 0 20 20"
            >
              <path
                stroke="currentColor"
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth="2"
                d="m19 19-4-4m0-7A7 7 0 1 1 1 8a7 7 0 0 1 14 0Z"
              />
            </svg>
          </div>
          <input
            type="search"
            id="default-search"
            className="block w-full p-4 pl-10 text-sm text-gray-900 border border-gray-300 rounded-lg bg-gray-50 focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500"
            placeholder="Search images"
            name="query"
            value={query}
            onChange={(e) => setQuery(e.target.value)}
            required
          />
          <button
            type="submit"
            className="text-white absolute right-2.5 bottom-2.5 bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:outline-none focus:ring-blue-300 font-medium rounded-lg text-sm px-4 py-2 dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800"
            onClick={searchImage}
          >
            Search
          </button>
        </div>
        <div className="bg-white">
          <div className="mx-auto max-w-2xl px-4 py-16 sm:px-6 sm:py-24 lg:max-w-7xl lg:px-8">
            <div className="mt-1 grid grid-cols-1 gap-x-6 gap-y-10 sm:grid-cols-2 lg:grid-cols-4 xl:gap-x-8">
              {data.map((image) => (
                <div
                  key={image.id}
                  className="group relative border rounded-lg p-3"
                >
                  <div className="aspect-h-1 aspect-w-1 w-full overflow-hidden rounded-md bg-gray-200 lg:aspect-none group-hover:opacity-75 lg:h-80">
                    <img
                      src={image.urls.regular}
                      alt={image.alt_description}
                      className="h-full w-full object-cover object-center lg:h-full lg:w-full"
                    />
                  </div>

                  <div className="mt-4 flex justify-between">
                    <div>
                      <img
                        className="h-8 w-8 rounded-full border border-1 border-black border-solid"
                        src={image.user.profile_image.small}
                        alt=""
                      />
                      <h3 className="text-sm text-gray-700">
                        {image.user.name}
                      </h3>
                      <h3 className="text-sm text-gray-700">
                        @{image.user.instagram_username}
                      </h3>
                    </div>

                    <p className="text-sm font-medium text-gray-900">
                      <img
                        src="https://d3sxshmncs10te.cloudfront.net/icon/free/svg/1853251.svg?token=eyJhbGciOiJoczI1NiIsImtpZCI6ImRlZmF1bHQifQ__.eyJpc3MiOiJkM3N4c2htbmNzMTB0ZS5jbG91ZGZyb250Lm5ldCIsImV4cCI6MTY5Nzc2MDAwMCwicSI6bnVsbCwiaWF0IjoxNjk3NTI3MzI5fQ__.178561ed00c7417a457c9cbce1fe14a09e299d433f35f6d692acf8c23b9d3feb"
                        alt="like"
                        style={{ height: "20px", width: "20px" }}
                      />
                      {image.likes}
                    </p>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </form>
    </>
  );
};

export default SearchInput;
